import React from 'react'

const types = ["Hand Tossed", " Thin Crust", "Handmade Pan", "Gluten Free Crust"]

const pizzaTypes = types.map(types => <div><p>{types}</p></div>)

const items = () => {
    return ({pizzaTypes})
}

export default items
